import React, {useState} from 'react';
import Axios from 'axios';
import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';


import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';

const LandingPage= (props)=> {
      const [roomId, setRoom] = useState('');
      const createroom = ()=> {
        Axios.get('http://localhost:5000/',{
          cors: {
            origin: "http://localhost:3000",
            methods: ["GET", "POST"]
          }
        }).then((res) =>{
          setRoom(res.data.link);
          
      });
        };
      
      const handlejoin=()=>{
        if(roomId)
        {
          props.history.push(`/${roomId}`);
        }
       
      }
      

      return (<React.Fragment>
      <div className="alignement-card" height="50%">
      <Card className="center card" height="200px">
      <CardContent align="center">
      <div><Button variant="contained" color="primary"  onClick={createroom}> Create Room</Button></div>
      
      <div>
      <TextField variant="outlined" color="white" type="text"  value={roomId} onChange={(e) =>{setRoom(e.target.value) }}/>
     </div>
     
      
      
      <div><Button variant="contained" color="primary" onClick={handlejoin} > Join Room</Button></div> 
      
      
      </CardContent>
      </Card>
      </div>
     
      </React.Fragment>
      )
};

export default LandingPage;
